import React from "react";
import Buttons from "./Buttons";

function Box() {
  return (
    <div id='quote-box' className='quote-box'>
      <div id='text'>
        <span>
          Go confidently in the direction of your dreams. Live the life you have
          imagined.
        </span>
      </div>
      <div id='author'>
        <span>-John Doe</span>
      </div>
      <Buttons />
    </div>
  );
}

export default Box;
